import React from 'react'
import {
    BrowserRouter as Router,
    Switch,
    Route,
  } from 'react-router-dom';

  import Home from './pages/Home'
  import DigitalCreations from './pages/DigitalCreations'
  import EventPlanning from './pages/EventPlanning'
  import Photography from './pages/Photography'
  import WritingSample from './pages/WritingSample'

  let Routes = () => {
    return (
        <div>
            <Router>
                <Switch>
                    <Route exact path="/" component={Home} />
                    <Route path="/DigitalCreations" component={DigitalCreations} />
                    <Route path="/EventPlanning" component={EventPlanning} />
                    <Route path="/Photography" component={Photography} />
                    <Route path="/WritingSample" component={WritingSample} />
                </Switch>
            </Router>
        </div>
    );
}
